        { id: 3, courseName: "Math", courseNum: "103" }
    ];
    const content = ["Problem Set","Quiz","Lab","Tutorial","Mid-term","Final"];

    return (
        <div>
        {courseInfo.map((value) => {
            return (
              <div>
                <p>{value.courseName} {value.courseNum}</p>
                <table>
                  <tr>
                    <th>first column</th>
                    <th>second column</th>
                  </tr>
                  <tr>
                    <th>1 column</th>
                    <th>2 column</th>
                  </tr>
                </table>

              </div>
            );
          })}
        </div>
    );
}
